import React from 'react';
import './Dashboard.css';
import dwi from '../Assets/dw.png';
const  Dashboard = ()=>{
    const queryParams = new URLSearchParams(window.location.search);
    const Username = queryParams.get('Username');
    function imagemov(){
        setImageHeight('28px');
        setImageWidth('28px');
    }
    function imgnm(){
        setImageHeight('25px');
        setImageWidth('25px');
    }
    function MouseOver(e) {
        e.target.style.fontWeight = 'bold'; // Use 'bold' for bold text
        const accele = document.getElementsByClassName("account");
        for (let element of accele) {
            // Set innerHTML with proper string formatting
            element.innerHTML = `
            <span>@${Username}</span>
            <div><img onMouseEnter={imagemov} class="imi" style="height: 25px; width: 25px; filter: invert(1);" src="${dwi}" alt="Girl in a jacket"/></div>`;
        }
    }
    function MouseLeave(e) {
        e.target.style.fontWeight = 'normal'; // Use 'normal' for default text weight
        const accele = document.getElementsByClassName("account");
        for (let element of accele) {
            
            element.innerHTML = `<span>@${Username}</span>`;
        }
    }
    
    return (

        <div className='main'>
              <div className="left">
               <div onMouseEnter={MouseOver} onMouseLeave={MouseLeave} className="lists account">
                <span >@{Username}</span>
               </div>
               <div className="lists dashboard">
               </div>
               <div className="lists reports">
               </div>
               <div className="lists settings">
               </div>
               <div className="letschat">
               </div>
               <div className="collapse_menu">
               </div>
              </div>
              <div className="right">

              </div>
        </div>
    );
}
export default Dashboard
